import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


import Title from "./components/Title";

class App extends Component {
  render() {
    return (
      <section>
        <div>
          <div>
            <Title></Title>
            <button>Crear cuenta</button>
          </div>
        </div>
      </section>
    );
  }
}

export default App;
